ERROR - 2024-05-30 13:51:11 --> Query error: Incorrect string value: '\xD0\xBC\xD1\x83\xD0\xB6...' for column 'located_at' at row 1 - Invalid query: INSERT INTO `center_director` (`center_academy_id`, `name`, `email`, `dob`, `address`, `state`, `country`, `zip`, `special_qualification`, `experience_bharathanatiyam` , `master_name`, `events_performance` , `located_at`, `award_title` , `other_relevant_info`, `ballets_choreographed` , `created_by`, `updated_by`, `created_at`) VALUES (9847, 'Myzh2jeP', 'yladams9749@outlook.com', '1970-01-01', 'Zubtsov', 'Togo', 'Vatican City', '123344', '', '', 'Myzh2jeP', '', 'муж на час', 'муж на час', 'Фестиваль весны в Спасо-хаусе\r\n«Давеча меня ошеломило; давеча некогда было соображать, - думал он, вспоминая первую встречу свою с Лизой, - ну а теперь - надо узнать». Ну я, конечно, стал растолковывать - так, мол, и так, спросил, где, мол, живете, какой губернии будете, обожаете ли кинематограф, ну там и о разном поговорили. Вижу, дело сурьезное, иначе, как без брака, ничего не выйдет, ну и стал я урезонивать: поговори, дескать, добром с мужем, может, и уломаешь, мы ему новую тройку сошьем и рублев пятьдесят отвалим, пущай дает развод, а я обзакониться не прочь. Явите Божескую милость, хошь она, может, и стерва, и воровка, и глаза мне отводила, а разыщите ее, пущай сидит в тюрьме, вшей кормит, хошь она и не стоющая моих чувств, все-таки иной раз в воскресный день я ей посылочку справлю да на личико ейное скрозь решетку погляжу. Рабочий день мастера из частной компании в будни завершается в 20.00, а некоторые фирмы сообщают и о возможности круглосуточного вызова специалистов. Вызвать специалиста можно в любой день недели, нестандартные виды работ оцениваются уже на месте. С этим ловким мошенником я уже сталкивался в Риге, где он фигурировал под ложным именем графа Рокетти де ля Рокка. Пришлось выработать следующий план: мой способный агент Швабо, переведенный мною в Москву из Риги, принимавший в свое время деятельное участие в аресте графа де ля Рокка и хорошо знавший <a href=https://myzh-na-chas777.ru/>вызвать мужа на час</a> его в лицо, был поставлен во главе этого розыска и бессменно дежурил в сыскной полиции и у своего домашнего телефона.\r\nРаков, мол, здесь, и Ильин (другой агент) играет с ним за одним столом. Всю ночь не спал, а наутро мне письмецо: так, мол, и так, заочно вам кланяюсь и сообщаю, что вчерась притить не могла, муж с пьяна побил, а в воскресенье, мол, непременно буду полчаса первого. Действительно, в воскресенье не надула, пришла ровнехонько полчаса первого, и просидели мы с ней за самоварчиком до двух часов, да и дело порешили. Ладно, - говорит Настя, - поговорю, а с ответом жди меня в четверг (это, стало быть, было за три дня до кражи). Ладно, - думаю, - буду ждать. Послушайте, Павел Павлович, мне решительно ведь все равно, согласитесь сами, знали вы там или не знали? Коляску я взял для себя-с, но почти уверен был, что вы согласитесь поехать, - ответил Павел Павлович с видом совершенно счастливого человека. Потому что наличие предварительного плана не только облегчает ему работу, но и сокращает ее продолжительность. Швабо всего лишь раз вызывался, но и то не признал в заподозренном Ракова. Ему в помощь я дал 20 агентов, снабженных фотографиями Ракова. Теперь предстояла нелегкая задача разыскать Ракова и им награбленное.\r\nВ третьем часу ночи выигравший Раков встал из-за стола, не торопясь прошел в буфет, вкусно поужинал, после чего вышел из клуба. Деньги, данные «на чай», вносились в буфет, где записывались и делились поровну. Для очистки совести я тотчас же навел справки и в адресном столе, и во всех полицейских участках, но, как и следовало ожидать, Раков не был прописан и не значился в числе выбывших. Дня через два опять была, потом опять и, что скрывать, скажу по совести, полюбилась она мне - во как! Готовясь жениться, произведенный в «молодцы» отправлялся на Маросейку, где над воротами красовались ножницы, а во дворе жил банный портной Иона Павлов. Молодой рудокоп, к которому относились эти слова, проходя во главе пятидесяти своих товарищей мимо говорившего, бросил презрительный взгляд на его нарядный туалет, а потом посмотрел на песчаную дорогу, по которой, поднимая пыль, топали в грубых башмаках рудокопы. Сомнений не было - за столом сидел Раков. Им были даны точные рисунки пропавших вещей, но они молчали, из чего следовало, что Раков либо бежал из Москвы, либо, оставаясь в ней, временно отсрочивает ликвидацию. Несколько лучше, по словам Тейера, обстояло дело с экспериментами над молоденькими козочками, но даже их присутствие приводило к дискомфорту в бальной зале (англ. Однако должен сказать, что препятствие вышло: оказалась она замужней, муж ейный служил половым в трактире Тестова.\r\nСбегал я на Никитинскую, дому номер 37, спрашиваю, у вас-де проживает половой от Тестова Николай, а мне говорят, что в этом доме живут господа разные и половых никогда не проживало. Ну, куда ни шло для такого дела. Ну, Сушкин, вижу, ты мне правду сказал. Ну, как скажешь им правду? Ну, конечно, ваше высокородие, не захотел я ударить лицом в грязь, опять же в первый раз буду принимать гостью дорогую. Ну, братец, на это не надейся. Об его шулерских проделках я писал уже в одном из предыдущих своих очерков (\\\"Король шулеров\\\"). Об их общественном положении я не знал ровно ничего. Доктор философии по истории Майкл Казелла-Блэкберн попытался найти место для Фестиваля весны в общем контексте повседневной жизни Москвы того времени. Доктор юридических наук Лев Симкин, специализирующийся в своих книгах для широкой аудитории на исторических расследованиях, в книге «Великий обман. Развернув письмо, я был приятно удивлен: на нижнем краю бумаги выделялся отчетливый отпечаток пальца, очевидно, писавшего. Этот милостивый государь если и пребывал в настоящее время в Москве, то проживал, очевидно, в ней снова под чужим именем. А я думаю - из коленкора под кожу. Можно по желанию работать после 20. Если позволяет график, можно совмещать работу с другой.', '